@lebondavidok y @conociendorusia cantaron juntos un verdadero clásico del cancionero popular argentino: "Seminare". Los acompañó la Orquesta Sinfónica de @uba200concierto dirigida por @ezesilber.

La Universidad de Buenos Aires celebró su bicentenario con un impactante concierto en las escalinatas de la Facultad de Derecho. Mirá el show completo en tvpublica.com.ar

